import React from 'react'
import Account from '../menu/acc.svg';
import '../mainWindow/window.css';

export default function Champion(){
    return(
        <div>
            <p className='h1'>TOP#</p>
            <img src={Account}/>
            <h4 className='h1' >ACCOUNT NAME</h4>
        </div>
    )
}
